police_stations = []
for feature in geojson['features']:
    props = feature['properties']
    coords = feature['geometry']['coordinates']
    station = {
        "name": props['nombre'],
        "address": props['direccion'],
        "lat": coords[1],  # lat is second
        "lon": coords[0],  # lon is first
    }
    police_stations.append(station)

print("POLICE_STATIONS = [")
for station in police_stations:
    print(f'    {station},')
print("]")